import { motion } from "framer-motion"
import estyle from "./TwobgLDarkFill.module.scss"

function TwobgLDarkFill({props}) {

    const svgVariants = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay, duration : 1 }}
    }

    // const startdot = {
    //     ready: { opacity:0, scale:0 },
